//Home.js-Module
import React, { Fragment } from 'react'
import { Link } from 'react-router-dom';
import profile from './../../assets/images/profile.jpg'

//Create Home Component
function Home() {

    return (<Fragment>
    
    <div>
    <h1 className="text-danger" style={{font}}>MS DHONI</h1>
    <img src={profile} className="card-img-top" style={{heiht:'200px',width:'300px',position:'relative',left:'1000px'}}/>
   
    </div>

   
        </Fragment>)
    
}

export default Home;
